import React, { useState,useEffect } from "react";
import { useForm } from "react-hook-form";
import { useTranslation } from "react-i18next";
import i18next from "i18next";
import { Route, Routes, Link, useNavigate } from "react-router-dom";

import { useData } from "../DataContext";
const Auto = () => {
    const navigate = useNavigate();
    const {data,setValues} = useData();
    const { t } = useTranslation();
    const [selectedLanguage, setSelectedLanguage] = useState("ky");

   const onChangeHandler = (e) => {
      const index = e.target.selectedIndex;
      const el = e.target.childNodes[index]
      const option =  el.getAttribute('id');  
      const selectedOption = e.target.value;
      setSelectedLanguage(selectedOption);
      i18next.changeLanguage(option)
    }
    const {
        register,
        formState: { errors, isValid },
        handleSubmit,
        reset,
        watch,
        getValues,
    } = useForm({ 
        defaultValues: {
            firstName : data.firstName,
             lastName:data.lastName,
             email: data.email,
              password: data.password, 
              passwordСonfirm: data.passwordСonfirm
        },
        mode: "onChange" });

    const onSubmit = (data) => {
        console.log(JSON.stringify(data));
        setValues(data);
        navigate('login-country')
    };
    return (
        <div className="reg">
            <div className="reg_btns">
                <div className="reg_light active"></div>
                <div className="reg_light"></div>
            </div>

            <form className="reg_form" onSubmit={handleSubmit(onSubmit)}>
                <div className="block1">
                <input
                        placeholder="e-mail"
                        className="password_confirm"
                        {...register("email", {
                            required: "поле обязательно к заполнению",
                            pattern: {
                                value: /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/,
                                message: "напишите правильный email",
                            },
                        })}
                    />



                </div>
                {errors?.email && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.email?.message}
                        </p>
                    )}
                <div className="block2">


                    <input
                        type="password"
                        placeholder={t("reg_password")}
                        className="password_confirm"
                        {...register("password", {
                            required: "поле обязательно к заполнению",
                            minLength: {
                                value: 4,
                                message: "минимум 4 буквы",
                            },
                        })}
                    />
                </div>
                <div >
                    {errors?.password && (
                        <p
                            style={{
                                color: "red",
                                marginTop: "10px",
                                paddingLeft: "15px",
                            }}
                        >
                            {errors?.password?.message}
                        </p>
                    )}

                </div>
                <div>
                </div>

                <div className="block4">
                    <button
                        className="reg_submit btn"
                        disabled={!isValid}
                        type="submit"
                    >
                        {t("reg_login")}
                    </button>
                </div>

                <div className="block5">
                    <p>
                        {t("auth_forgotPass")}{" "}
                        <Link to={'restore'}
                            style={{
                                textDecoration: "none",
                                color: "#7F3A85",
                                cursor: "pointer",
                            }}

                        >
                            {t("auth_newPass")}
                        </Link>
                    </p>
                </div>
                <div className="block6">
                    <p>
                        {t("auth_acc")}{" "}
                        <Link to={'/'}
                            style={{
                                textDecoration: "none",
                                color: "#7F3A85",
                                cursor: "pointer",
                            }}

                        >
                            {t("reg_submit")}
                        </Link>
                    </p>
                </div>

                <div className="block7">
                <select
  className="select-css"
  name="language"
  id="language"
  onChange={onChangeLangHandler}
      value={selectedLanguage}
>
  <option id="ky" value="ky">
    кыргызча
  </option>
  <option id="ru" value="ru">
    русский
  </option>
</select>
                </div>

            </form>
        </div>
    );
};

export default Auto;
